import React, { Fragment } from 'react';
import { Link } from 'react-router-dom';

class Menu extends React.Component {

  constructor(props)
  {
    super(props);
    this.state = {
      login: this.props.login
		}
  }

  render() {

    return (
      <div className="Menu">
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
            </ul>
            { this.state.login == true ? <Fragment><Link to="/logout">Logout</Link> | <Link to="/dashboard">Dashboard</Link></Fragment> : <Fragment><Link to="/login">Login</Link> | <Link to="/register">Register</Link></Fragment>}
      </div>
    )
  }
}

export default Menu;
